(74, 1, '2020-08-01 22:58:19', '2020-08-02 01:58:19', '<img width=\"768\" height=\"769\" src=\"http://localhost/vitianji/wp-content/uploads/2020/08/andrea-768x769.jpg\" alt=\"\" srcset=\"http://localhost/vitianji/wp-content/uploads/2020/08/andrea-768x769.jpg 768w, http://localhost/vitianji/wp-content/uploads/2020/08/andrea-300x300.jpg 300w, http://localhost/vitianji/wp-content/uploads/2020/08/andrea-1024x1024.jpg 1024w, http://localhost/vitianji/wp-content/uploads/2020/08/andrea-150x150.jpg 150w, http://localhost/vitianji/wp-content/uploads/2020/08/andrea.jpg 1080w\" sizes=\"(max-width: 768px) 100vw, 768px\" />											\n		<p>Mi nombre es Andrea Avalos, soy de San Miguel de Tucuman, Argentina. Estudio ingeniería en computación en la UNT, voy en segundo año. Comenzar con este emprendimiento nació porque quería un poco de independencia y poder ayudar a pagar mis estudios, ésto sumado a que me gusta cocinar, se me ocurrió vender estos elementos de cocina suministrados por la empresa Essen, que tiene productos de gran calidad y de confianza.</p>		\n			<h2>Redes:</h2>		\n							<a href=\"https://www.facebook.com/108794527337846/posts/184695586414406/\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Facebook\n									</a>\n							<a href=\"https://instagram.com/essen.by.andrea?igshid=9gr5glj093jl\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Instagram\n									</a>\n							<a href=\"http://wa.me/5493813673859\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Whatsapp\n									</a>\n			<iframe frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"https://maps.google.com/maps?q=san%20miguel%20de%20tucuman%2C%20tucuman%2C%20Argentina&amp;t=m&amp;z=10&amp;output=embed&amp;iwloc=near\" aria-label=\"san miguel de tucuman, tucuman, Argentina\"></iframe>', 'Sobre mi', '', 'publish', 'closed', 'closed', '', 'sobre-mi', '', '', '2020-08-02 21:48:21', '2020-08-03 00:48:21', '', 0, 'http://localhost/vitianji/?page_id=74', 0, 'page', '', 0),
