(107, 1, '2020-08-02 21:00:09', '2020-08-03 00:00:09', '<img width=\"768\" height=\"769\" src=\"http://localhost/vitianji/wp-content/uploads/2020/08/andrea-768x769.jpg\" alt=\"\" srcset=\"http://localhost/vitianji/wp-content/uploads/2020/08/andrea-768x769.jpg 768w, http://localhost/vitianji/wp-content/uploads/2020/08/andrea-300x300.jpg 300w, http://localhost/vitianji/wp-content/uploads/2020/08/andrea-1024x1024.jpg 1024w, http://localhost/vitianji/wp-content/uploads/2020/08/andrea-150x150.jpg 150w, http://localhost/vitianji/wp-content/uploads/2020/08/andrea.jpg 1080w\" sizes=\"(max-width: 768px) 100vw, 768px\">\n\nMi nombre es Andrea Avalos, estudio ingeniería en computación en la UNT, segundo año, y comenzar con este emprendimiento nació porque quería un poco de independencia y poder ayudar a pagar mis estudios, ésto sumado a que me gusta cocinar, se me ocurrió vender estos elementos de cocina.\n<h2>Redes:</h2>\n<a target=\"_blank\" rel=\"noopener noreferrer\">\nFacebook\n</a>\n<a href=\"https://instagram.com/essen.by.andrea?igshid=9gr5glj093jl\" target=\"_blank\" rel=\"noopener noreferrer\">\nInstagram\n</a>\n<a href=\"http://wa.me/5493813673859\" target=\"_blank\" rel=\"noopener noreferrer\">\nWhatsapp\n</a>', 'Sobre mi', '', 'inherit', 'closed', 'closed', '', '74-revision-v1', '', '', '2020-08-02 21:00:09', '2020-08-03 00:00:09', '', 74, 'http://localhost/vitianji/index.php/2020/08/02/74-revision-v1/', 0, 'revision', '', 0),
(109, 1, '2020-08-02 21:06:25', '2020-08-03 00:06:25', '<img width=\"768\" height=\"769\" src=\"http://localhost/vitianji/wp-content/uploads/2020/08/andrea-768x769.jpg\" alt=\"\" srcset=\"http://localhost/vitianji/wp-content/uploads/2020/08/andrea-768x769.jpg 768w, http://localhost/vitianji/wp-content/uploads/2020/08/andrea-300x300.jpg 300w, http://localhost/vitianji/wp-content/uploads/2020/08/andrea-1024x1024.jpg 1024w, http://localhost/vitianji/wp-content/uploads/2020/08/andrea-150x150.jpg 150w, http://localhost/vitianji/wp-content/uploads/2020/08/andrea.jpg 1080w\" sizes=\"(max-width: 768px) 100vw, 768px\" />											\n		<p>Mi nombre es Andrea Avalos, soy de San Miguel de Tucuman, Argentina. Estudio ingeniería en computación en la UNT, voy en segundo año. Comenzar con este emprendimiento nació porque quería un poco de independencia y poder ayudar a pagar mis estudios, ésto sumado a que me gusta cocinar, se me ocurrió vender estos elementos de cocina suministrados por la empresa Essen, que tiene productos de gran calidad y de confianza.</p>		\n			<h2>Redes:</h2>		\n							<a target=\"_blank\" rel=\"noopener noreferrer\">\n					Facebook\n									</a>\n							<a href=\"https://instagram.com/essen.by.andrea?igshid=9gr5glj093jl\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Instagram\n									</a>\n							<a href=\"http://wa.me/5493813673859\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Whatsapp\n									</a>\n			<iframe frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"https://maps.google.com/maps?q=san%20miguel%20de%20tucuman%2C%20tucuman%2C%20Argentina&amp;t=m&amp;z=10&amp;output=embed&amp;iwloc=near\" aria-label=\"san miguel de tucuman, tucuman, Argentina\"></iframe>', 'Sobre mi', '', 'inherit', 'closed', 'closed', '', '74-revision-v1', '', '', '2020-08-02 21:06:25', '2020-08-03 00:06:25', '', 74, 'http://localhost/vitianji/index.php/2020/08/02/74-revision-v1/', 0, 'revision', '', 0),
(110, 1, '2020-08-02 21:25:37', '2020-08-03 00:25:37', '<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size has-very-dark-gray-color\">Se realizan entregas a toda la provincia, llevamos el producto personalmente o podemos enviarlo por correo en caso de que el cliente sea del interior de la provincia. No duden en comunicarse conmigo mediante cualquiera de mis redes sociales. Espero su consulta :)</p>\n<!-- /wp:paragraph -->', 'Entregas a todo Tucuman', '', 'publish', 'open', 'open', '', 'entregas-a-todo-tucuman', '', '', '2020-08-02 21:25:37', '2020-08-03 00:25:37', '', 0, 'http://localhost/vitianji/?p=110', 0, 'post', '', 0);
