(111, 1, '2020-08-02 21:25:37', '2020-08-03 00:25:37', '<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size has-very-dark-gray-color\">Se realizan entregas a toda la provincia, llevamos el producto personalmente o podemos enviarlo por correo en caso de que el cliente sea del interior de la provincia. No duden en comunicarse conmigo mediante cualquiera de mis redes sociales. Espero su consulta :)</p>\n<!-- /wp:paragraph -->', 'Entregas a todo Tucuman', '', 'inherit', 'closed', 'closed', '', '110-revision-v1', '', '', '2020-08-02 21:25:37', '2020-08-03 00:25:37', '', 110, 'http://localhost/vitianji/index.php/2020/08/02/110-revision-v1/', 0, 'revision', '', 0),
(112, 1, '2020-08-02 21:26:24', '2020-08-03 00:26:24', '<!-- wp:paragraph -->\n<p>Bienvenido a WordPress. Esta es tu primera entrada. Editala o borrala, y después ¡empezá a escribir!</p>\n<!-- /wp:paragraph -->', '¡Hola mundo!', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2020-08-02 21:26:24', '2020-08-03 00:26:24', '', 1, 'http://localhost/vitianji/index.php/2020/08/02/1-revision-v1/', 0, 'revision', '', 0),
(113, 1, '2020-08-02 21:31:10', '2020-08-03 00:31:10', '<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size has-very-dark-gray-color\">Proximamente estaré actualizando las listas de productos que aparecen en la página principal, llegarán nuevos sets y se aplicarán descuentos con la compra de un set completo, daré mas información en mis redes. Estén atentos!!</p>\n<!-- /wp:paragraph -->', 'Nuevos Productos en Agosto', '', 'publish', 'open', 'open', '', 'nuevos-productos-en-agosto', '', '', '2020-08-02 21:31:10', '2020-08-03 00:31:10', '', 0, 'http://localhost/vitianji/?p=113', 0, 'post', '', 0),
(114, 1, '2020-08-02 21:31:10', '2020-08-03 00:31:10', '<!-- wp:paragraph {\"textColor\":\"very-dark-gray\",\"fontSize\":\"normal\"} -->\n<p class=\"has-text-color has-normal-font-size has-very-dark-gray-color\">Proximamente estaré actualizando las listas de productos que aparecen en la página principal, llegarán nuevos sets y se aplicarán descuentos con la compra de un set completo, daré mas información en mis redes. Estén atentos!!</p>\n<!-- /wp:paragraph -->', 'Nuevos Productos en Agosto', '', 'inherit', 'closed', 'closed', '', '113-revision-v1', '', '', '2020-08-02 21:31:10', '2020-08-03 00:31:10', '', 113, 'http://localhost/vitianji/index.php/2020/08/02/113-revision-v1/', 0, 'revision', '', 0),
